import React from 'react'

function Header() {
const headerLink = [
    {text: "blog", id: 1, url: "/"},
    {text: "About", id: 2, url: "/"},
    {text: "Links", id: 3, url: "/"},
    {text: "Contact", id: 4, url: "/"}
]

  return (
    <div className="justify-between p-3 items-center border-[1px] flex">
      <h1 className=" text-3xl"> Dealiest Blog</h1>
      <div className="flex text-lg">
        {headerLink.map((Link) => 
        <ul key={Link.id} className="">
            <li className=" gap-3">{Link.text}</li>
        </ul>)}
            </div>
    </div>
  )
}

export default Header
